            err = 0.5 * (err_u + err_v)
        else:
            transp = get_Gamma(alpha, beta, u, v)
            err = nx.norm(nx.sum(transp, axis=0) - b)
        if log:
            log['err'].append(err)
        if verbose:
            if ii % (print_period * 20) == 0:
                print('{:5s}|{:12s}'.format('It.', 'Err') + '\n' + '-' * 19)
            print('{:5d}|{:8e}|'.format(ii, err))
    if err <= stopThr:
        flag_else = 0
        break
    if nx.any(nx.isnan(u)) or nx.any(nx.isnan(v)):
        warnings.warn('Numerical errors at iteration %d' % ii)
        u = uprev
        v = vprev
        flag_else = 0
        break
if flag_else:
    if warn:
        warnings.warn('Sinkhorn did not converge. You might want to increase the number of iterations `numItermax` or the regularization parameter `reg`.')

